import React, { useState } from 'react';

function App() {
  const [dates, setDates] = useState([]);
  const [newDate, setNewDate] = useState({ name: '', rating: 5, notes: '' });
  const [activeTab, setActiveTab] = useState('home');

  const addDate = () => {
    if (newDate.name.trim()) {
      const dateWithId = {
        ...newDate,
        id: Date.now(),
        date: new Date().toLocaleDateString()
      };
      setDates([...dates, dateWithId]);
      setNewDate({ name: '', rating: 5, notes: '' });
    }
  };

  const removeDate = (id) => {
    setDates(dates.filter(date => date.id !== id));
  };

  const testAPI = async () => {
    try {
      const response = await fetch('http://localhost:5001/health');
      const data = await response.json();
      alert(`API Test: ${data.message}`);
    } catch (error) {
      alert('API Test Failed: ' + error.message);
    }
  };

  const renderHome = () => (
    <div>
      <h1 style={{ color: '#1976d2' }}>🎯 Roster.AI</h1>
      <p>Welcome to your dating evaluation platform!</p>

      <div style={{ marginTop: '30px' }}>
        <h2>Features:</h2>
        <ul>
          <li>✅ Evaluate your dates</li>
          <li>✅ Build your roster</li>
          <li>✅ Get AI insights</li>
          <li>✅ Track dating progress</li>
        </ul>
      </div>

      <div style={{ marginTop: '30px', padding: '20px', backgroundColor: '#f5f5f5', borderRadius: '8px' }}>
        <h3>Quick Actions:</h3>
        <button 
          onClick={() => setActiveTab('add-date')}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#1976d2', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Add New Date
        </button>
        <button 
          onClick={() => setActiveTab('roster')}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#dc004e', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          View Roster ({dates.length})
        </button>
        <button 
          onClick={testAPI}
          style={{ 
            margin: '5px', 
            padding: '10px 20px', 
            backgroundColor: '#4caf50', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Test API
        </button>
      </div>

      <div style={{ marginTop: '30px', fontSize: '14px', color: '#666' }}>
        <p>Backend API: ✅ Running on port 5001</p>
        <p>Frontend: ✅ Running on port 3001</p>
        <p>Total Dates in Roster: {dates.length}</p>
      </div>
    </div>
  );

  const renderAddDate = () => (
    <div>
      <h2>📝 Add New Date</h2>
      <div style={{ maxWidth: '400px', margin: '20px 0' }}>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Name:</label>
          <input
            type="text"
            value={newDate.name}
            onChange={(e) => setNewDate({...newDate, name: e.target.value})}
            style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd' }}
            placeholder="Enter their name"
          />
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Rating (1-10):</label>
          <input
            type="range"
            min="1"
            max="10"
            value={newDate.rating}
            onChange={(e) => setNewDate({...newDate, rating: parseInt(e.target.value)})}
            style={{ width: '100%' }}
          />
          <span>{newDate.rating}/10</span>
        </div>
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '5px' }}>Notes:</label>
          <textarea
            value={newDate.notes}
            onChange={(e) => setNewDate({...newDate, notes: e.target.value})}
            style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #ddd', height: '80px' }}
            placeholder="How was the date? Any red/green flags?"
          />
        </div>
        <button 
          onClick={addDate}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#1976d2', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer',
            marginRight: '10px'
          }}
        >
          Add to Roster
        </button>
        <button 
          onClick={() => setActiveTab('home')}
          style={{ 
            padding: '10px 20px', 
            backgroundColor: '#666', 
            color: 'white', 
            border: 'none', 
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Back to Home
        </button>
      </div>
    </div>
  );

  const renderRoster = () => (
    <div>
      <h2>👥 Your Dating Roster</h2>
      {dates.length === 0 ? (
        <p>No dates added yet. <button onClick={() => setActiveTab('add-date')} style={{ color: '#1976d2', background: 'none', border: 'none', cursor: 'pointer', textDecoration: 'underline' }}>Add your first date!</button></p>
      ) : (
        <div>
          {dates.map(date => (
            <div key={date.id} style={{ 
              border: '1px solid #ddd', 
              borderRadius: '8px', 
              padding: '15px', 
              margin: '10px 0',
              backgroundColor: '#f9f9f9'
            }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <h3 style={{ margin: '0' }}>{date.name}</h3>
                <button 
                  onClick={() => removeDate(date.id)}
                  style={{ 
                    backgroundColor: '#dc004e', 
                    color: 'white', 
                    border: 'none', 
                    borderRadius: '4px', 
                    padding: '5px 10px',
                    cursor: 'pointer'
                  }}
                >
                  Remove
                </button>
              </div>
              <p style={{ margin: '5px 0', color: '#666' }}>Date: {date.date}</p>
              <p style={{ margin: '5px 0' }}>Rating: {'⭐'.repeat(date.rating)} ({date.rating}/10)</p>
              {date.notes && <p style={{ margin: '5px 0' }}>Notes: {date.notes}</p>}
            </div>
          ))}
        </div>
      )}
      <button 
        onClick={() => setActiveTab('home')}
        style={{ 
          marginTop: '20px',
          padding: '10px 20px', 
          backgroundColor: '#666', 
          color: 'white', 
          border: 'none', 
          borderRadius: '4px',
          cursor: 'pointer'
        }}
      >
        Back to Home
      </button>
    </div>
  );

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', maxWidth: '800px', margin: '0 auto' }}>
      {activeTab === 'home' && renderHome()}
      {activeTab === 'add-date' && renderAddDate()}
      {activeTab === 'roster' && renderRoster()}
    </div>
  );
}

export default App;
